import React from 'react';
import './App.css';
import axios from 'axios';
import FlatList from 'flatlist-react';
import * as ReactBootStrap from 'react-bootstrap';
class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      count: 0,
      players : [
        {position: "hdf", name: "jland", team: "a,msn"},
        {position: "skjdn", name: "asd", team: "mnb"},
        {position: "nmbc", name: "nsab", team: "ndbkj"},
        {position: "lkajd", name: "jhj", team: "jaHDL"},
        {position: "mxncv,m", name: "jsahd", team: "LKASHD"},
      ]
    };
  }
  componentDidMount() {
    axios.get(`http://localhost:10010/films?page=1&limit=10`,{headers : {
    "Access-Control-Allow-Origin": "*",
    "Access-Control-Allow-Methods": "GET,PUT,POST,DELETE,PATCH,OPTIONS"
    }
  })
      .then(res => {
        // const players = res.data;
        console.log(res);
        this.setState({ players:res.data.data });
      }).catch (error => {
        console.log('.....error........',error);
      })
  }
  renderPlayer = (player,index) => {

    return(
      <tr key = {index}>
        <td>{player.album}</td>
        <td>{player.bytes}</td>
        <td>{player.genre}</td>
      </tr>
    )
  }
  render() {
    return (
      <div className="App">
      <button>Fetch</button>
      <ReactBootStrap.Table striped bordered hover variant="dark">
  <thead>
    <tr>
      <th>First Name</th>
      <th>Last Name</th>
      <th>Username</th>
    </tr>
  </thead>
  <tbody>
  <FlatList
          list={this.props.people}
          renderItem={this.renderPerson}
          renderWhenEmpty={() => <div>List is empty!</div>}
          sortBy={["firstName", {key: "lastName", descending: true}]}
          groupBy={person => person.info.age > 18 ? 'Over 18' : 'Under 18'}
        />
    {/* {this.state.players.map(this.renderPlayer)} */}
  </tbody>
</ReactBootStrap.Table>
    </div>
    );
  }
}
